package com.hackerrank.Strings;

import java.util.*;

public class GameOfThrones {
    private static final Scanner scanner = new Scanner(System.in);

    // Complete the gameOfThrones function below.
    static String gameOfThrones(String s) {

        boolean isStringLengthEven = (s.length() % 2 == 0);
        List<Character> charList = new ArrayList<>();
        Map<Character, Integer> charMap = new HashMap<>();

        char[] charArray = s.toCharArray();
        for (int i = 0; i < charArray.length; i++) {
            charList.add(charArray[i]);
        }
        charList.stream().forEach(element -> {
            if (charMap.containsKey(element)) {
                int countOfElement = charMap.get(element);
                charMap.put(element, countOfElement + 1);

            } else {
                charMap.put(element, 1);
            }
        });

        boolean result;
        if (isStringLengthEven) {
            result = charMap.values().stream().allMatch(integer -> (integer % 2 == 0));
            return result ? "YES" : "NO";
        } else {
            long countNonPairChars = 0;
            for (Integer i : charMap.values()) {
                if (i % 2 == 0) {
                    continue;
                } else {
                    countNonPairChars++;
                }
            }
            if (countNonPairChars > 1) {
                return "NO";
            } else {
                return "YES";
            }
        }
    }

    public static void main(String[] args) {

        //System.out.printf("args = %s%n", gameOfThrones(""));


        String s = scanner.nextLine();

        long startTime = System.nanoTime();

        /* ... the code being measured starts ... */

        String result = gameOfThrones(s);
        /* ... the code being measured ends ... */

        long endTime = System.nanoTime();

        // get difference of two nanoTime values
        long timeElapsed = endTime - startTime;

        System.out.println("Execution time in nanoseconds  : " + timeElapsed);

        System.out.println("Execution time in milliseconds : " +
                timeElapsed / 1000000);


        System.out.println("result = " + result);

    }
}
